@teesey1228 にゃわーーん！にゃおーーーん！って感じですねw
にゃんトークっていう、無料の猫語のアプリで翻訳したら『愛する人よ』とか『ここにいるよ』とか、とにかく甘えたい感じの鳴き声みたいでした😂
キキたんは全然夜鳴きせずで、夜中にお散歩はしますが我関せずですね！

@XIzuTDy1johDEDA ｵﾎﾎﾎにゃんでぃ様とはきゃわわぁな にゃんトークをしながら素敵な午後を過ごしたこと、とても優雅で楽しいお時間でしたわ🥰

皆様に支えていただきながら、本当に愛おしい想い出ばかりの一年でございましたわ🥲
今年経験させていただいた事を学びとして、来年も皆様と楽しい一年にしたいですの🥲💐
